@test integrate((c+d*x)^-2*cos(a+b*x)^2, x) == :(-1*d^-1*(c+d*x)^-1*cos(a+b*x)^2+-1*b*d^-2*cos(2a+-2*b*c*d^-1)*sinintegral(2*b*x+2*b*c*d^-1)+-1*b*d^-2*cosintegral(2*b*x+2*b*c*d^-1)*sin(2a+-2*b*c*d^-1))
