@test integrate((c+d*x)^3*cos(a+b*x)^3, x) == :(-40//9*b^-4*d^3*cos(a+b*x)+-2//27*b^-4*d^3*cos(a+b*x)^3+2//3*b^-1*(c+d*x)^3*sin(a+b*x)+2*d*b^-2*(c+d*x)^2*cos(a+b*x)+-40//9*b^-3*d^2*(c+d*x)*sin(a+b*x)+1//3*d*b^-2*(c+d*x)^2*cos(a+b*x)^3+1//3*b^-1*(c+d*x)^3*cos(a+b*x)^2*sin(a+b*x)+-2//9*b^-3*d^2*cos(a+b*x)^2*(c+d*x)*sin(a+b*x))
